Borrowed reference to an OS string (see [`OsString`](../struct.OsString.html "struct std::ffi::OsString")).

This type represents a borrowed reference to a string in the operating systemâ€™s preferred representation.

`&OsStr` is to [`OsString`](../struct.OsString.html "struct std::ffi::OsString") as `&[str](../../primitive.str.html "primitive str")` is to [`String`](../../string/struct.String.html "struct std::string::String"): the former in each pair are borrowed references; the latter are owned strings.

See the [moduleâ€™s toplevel documentation about conversions](about:blank/index.html#conversions "mod std::ffi") for a discussion on the traits which `OsStr` implements for [conversions](about:blank/index.html#conversions "mod std::ffi") from/to native representations.

