1.9.0 Â· [source](about:blank/src/std/ffi/os_str.rs.html#948-950)

Returns the length of this `OsStr`.

Note that this does **not** return the number of bytes in the string in OS string form.

The length returned is that of the underlying storage used by `OsStr`. As discussed in the [`OsString`](../struct.OsString.html "struct std::ffi::OsString") introduction, [`OsString`](../struct.OsString.html "struct std::ffi::OsString") and `OsStr` store strings in a form best suited for cheap inter-conversion between native-platform and Rust string forms, which may differ significantly from both of them, including in storage size and encoding.

This number is simply useful for passing to other methods, like [`OsString::with_capacity`](about:blank/struct.OsString.html#method.with_capacity "associated function std::ffi::OsString::with_capacity") to avoid reallocations.

See the main `OsString` documentation information about encoding and capacity units.

##### [Â§](#examples-5)Examples

```
use std::ffi::OsStr;

let os_str = OsStr::new("");
assert_eq!(os_str.len(), 0);

let os_str = OsStr::new("foo");
assert_eq!(os_str.len(), 3);
```

